import React, { useEffect, useState } from "react";

function AnimalById() {
    const [animal, setAnimal] = useState()

    useEffect(() => {
        fetch(`${window.location.pathname}`)
        .then((res) => res.json())
        .then((res) => setAnimal(res))
    })

    return (
        <div>
            <div>
                <h1>{animal.name}</h1>
            </div>
        </div>
    )
}

export default AnimalById;
